import './App.css';
import { Container, Row, Col } from "reactstrap";

function App() {

  return (
    <>
    <Container>
    <Row>
      <Col md={4}><h1>6</h1></Col>
      <Col md={8}><h1>7</h1></Col>
    </Row>
    </Container>
    <h1>5</h1>
    </>

  );
}

export default App;
